import React from 'react';
import './text-image.css';
// import Header from '../header';
// import Footer from '../footer';
export default function HomeFeatures(text, image) {
  return (
    <div className="landing-1">
      <div className="landing-1-1">
        <h1>Subscription Management Made Easy!</h1>
        <p>{text.text}</p>
        <div className="landing-btn">
          <button className="register-btn">REGISTER</button>
          <button className="login-btn">LOGIN</button>
        </div>
        <div>
          <img
            src={image.image}
            alt="Partners icons"
            width="518px"
            height="70px"
          />
        </div>
      </div>

      <div className="landing-1-2">
        <img src={image} alt="a girl" />
        {/* <img src={blackwoman} alt="blackwoman" /> */}
      </div>
    </div>
  );
}
